import About from "./components/About";
import Hero from "./components/Hero";
import Navbar from "./components/Navbar";
import Sponsor from "./components/Sponsor";
import {Link} from "react-router-dom"

const Home = () => {
  return(
    <>
      <Navbar />
      <Hero />
      <Sponsor />
      <About />
    </>
  );
}

function App() {
  return(
    <div>
      <Link to='/'>Home</Link>
    </div>
  )
}

export default App;
